//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAV_EVENT_CURRENT_SEQUENCE_FLAGS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAV_EVENT_CURRENT_SEQUENCE_FLAGS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAV_EVENT_CURRENT_SEQUENCE_FLAGS_RESET.MarshalText()
		require.NoError(t, err)

		var dec MAV_EVENT_CURRENT_SEQUENCE_FLAGS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAV_EVENT_CURRENT_SEQUENCE_FLAGS_RESET, dec)
	})
}
